import EventsList from '../components/EventsList';

const DUMMY_EVENTS =[
    {
      title: 'event1',
      image: 'img',
      date: '2022-01-01',
      description: 'This is first event'
    },
    {
      title: 'event2',
      image: 'img',
      date: '2023-02-01',
      description: 'This is second event'
    },
    {
      title: 'event3',
      image: 'img',
      date: '2023-11-01',
      description: 'This is third event'
    },
];
const Events = () => {
    return <EventsList events={DUMMY_EVENTS}/>
}

export default Events;
